Well that was quite the mad weekend. The final hoorah. The final yippee. And what a finale it was. 
@oppenheimermovie came home with a bucket load of Oscar’s and I couldn’t be prouder for this movie and the people that made it and those who’s work was honoured with receiving their awards.
The last few months has been such a beautiful experience. I have an unbelievable amount of thank yous to all the people I’ve worked with during these press tours, I truly wouldn’t be able to do it without you. All the hands who tweaked and painted and sewed and brushed and dyed and steamed and drove and helped to get me out the door and to these places- you’re incredible and I bow down to your talent and skills. 
Here’s to another corker of a night. 

