My goodness. I know I’m not great and getting these moments out straight away but it’s always because I’m genuinely allowing it to soak in and I spend the most of the next day just reminiscing about how beautiful and utterly barmy these moments in life are. 
The @dunemovie global premiere was one of the most exciting and joyful events I’ve had the pleasure of going to, and once again my wonderful family and friends came in full supportive force.
Having Granny Pat on the carpet is the gift that just keeps giving. Thank you to all of you who were cheering her, her smile when she trotted on has been firmly mentally recorded in my mind forever. It’s such a beautiful feeling knowing everyone also thinks she’s a star. 
And to fans who were there waiting with such wonderful smiley faces- we appreciate you HUGELY and the energy you gave us carried through all evening. 
To those who painted, brushed, dressed and poked me for the many hours prior to premiere, I couldn’t do it without you. I am always grateful and always blown away by the love and support you give me until the very last second I leave the room. 
