With every day that’s passed I’ve been reminiscing and lodging moments of wonderful madness into my brain, making sure I process it all. I think that’s why I’ve been so hesitant to post because there’s just so much I want to say ‘thank you’ for. That and also, I don’t know how I’ve done it, but I’ve managed to wangle making a best friend who sees me truly. Walking in to The Met on @pppiccioli’s arm with the fantastic @maisonvalentino family made me so proud. 
In one week our campaign came out and we walked those famous carpet steps and in both occasions I felt like who I am and what I want to be seen as is protected and praised. 
I told Pierpaolo back in March that by that point I’d be buzzed, his face lit up and quite literally beamed with the opportunity of what we could do and how to highlight it. 
@pppiccioli collaborating with you feels like I’ll be counting my blessings for eternity. I will be. Don’t worry. 
Thank you to you and all of your team. For designing me the best armour, for creating the right moment no matter which occasion. 
Thank you to the sewers and the makers, the driers and the headpiece pliers. 
Wearing your creation was something I’ll be cherishing for a lifetime. 

And to my beautiful wonderful glam team- you always make getting ready worth looking forward to. 

